      out.write("		<script>\r\n");
      out.write("		function numberToWordsIndianCurrency(number) {\r\n");
      out.write("		    const ones = [\"\", \"One\", \"Two\", \"Three\", \"Four\", \"Five\", \"Six\", \"Seven\", \"Eight\", \"Nine\"];\r\n");
      out.write("		    const teens = [\"Ten\", \"Eleven\", \"Twelve\", \"Thirteen\", \"Fourteen\", \"Fifteen\", \"Sixteen\", \"Seventeen\", \"Eighteen\", \"Nineteen\"];\r\n");
      out.write("		    const tens = [\"\", \"\", \"Twenty\", \"Thirty\", \"Forty\", \"Fifty\", \"Sixty\", \"Seventy\", \"Eighty\", \"Ninety\"];\r\n");
      out.write("		    const scales = [\"\", \"Thousand\", \"Lakh\", \"Crore\"]; // Indian scales\r\n");
      out.write("\r\n");
      out.write("		    if (number === 0) return \"Zero Rupees\";\r\n");
      out.write("\r\n");
      out.write("		    let words = \"\";\r\n");
      out.write("\r\n");
      out.write("		    function getHundreds(num) {\r\n");
      out.write("		        let result = \"\";\r\n");
      out.write("		        if (num > 99) {\r\n");
      out.write("		            result += ones[Math.floor(num / 100)] + \" Hundred \";\r\n");
      out.write("		            num %= 100;\r\n");
      out.write("		        }\r\n");
      out.write("		        if (num > 19) {\r\n");
      out.write("		            result += tens[Math.floor(num / 10)] + \" \";\r\n");
      out.write("		            num %= 10;\r\n");
      out.write("		        } else if (num >= 10) {\r\n");
      out.write("		            result += teens[num - 10] + \" \";\r\n");
      out.write("		            return result;\r\n");
      out.write("		        }\r\n");
      out.write("		        result += ones[num] + \" \";\r\n");
      out.write("		        return result;\r\n");
      out.write("		    }\r\n");
      out.write("\r\n");
      out.write("		    // Process the number in Indian scales: Crore, Lakh, Thousand, Hundred, etc.\r\n");
      out.write("		    if (number >= 10000000000) { // For Lakh Crores\r\n");
      out.write("		        let lakhCrorePart = Math.floor(number / 10000000000);\r\n");
      out.write("		        words += getHundreds(lakhCrorePart) + \"Lakh Crore \";\r\n");
      out.write("		        number %= 10000000000;\r\n");
      out.write("		    }\r\n");
      out.write("		    if (number >= 10000000) { // For Crores\r\n");
      out.write("		        let crorePart = Math.floor(number / 10000000);\r\n");
      out.write("		        words += getHundreds(crorePart) + \"Crore \";\r\n");
      out.write("		        number %= 10000000;\r\n");
      out.write("		    }\r\n");
      out.write("		    if (number >= 100000) { // For Lakhs\r\n");
      out.write("		        let lakhPart = Math.floor(number / 100000);\r\n");
      out.write("		        words += getHundreds(lakhPart) + \"Lakh \";\r\n");
      out.write("		        number %= 100000;\r\n");
      out.write("		    }\r\n");
      out.write("		    if (number >= 1000) { // For Thousands\r\n");
      out.write("		        let thousandPart = Math.floor(number / 1000);\r\n");
      out.write("		        words += getHundreds(thousandPart) + \"Thousand \";\r\n");
      out.write("		        number %= 1000;\r\n");
      out.write("		    }\r\n");
      out.write("		    if (number > 0) { // For Hundreds and below\r\n");
      out.write("		        words += getHundreds(number);\r\n");
      out.write("		    }\r\n");
      out.write("\r\n");
      out.write("		    return words.trim() + \" 	Rupees\"; // Append \"Rupees\" at the end\r\n");
      out.write("		}\r\n");
      out.write("\r\n");
      out.write("		// Example usage:\r\n");
      out.write("		console.log(numberToWordsIndianCurrency(2000000000000)); // \"Two Lakh Crore Rupees\"\r\n");
