      out.write("		console.log(numberToWordsIndianCurrency(20000000000)); // \"Two Thousand Crore Rupees\"\r\n");
      out.write("		console.log(numberToWordsIndianCurrency(2000000000));  // \"Two Hundred Crore Rupees\"\r\n");
      out.write("		console.log(numberToWordsIndianCurrency(2000000));     // \"Twenty Lakh Rupees\"\r\n");
